data Particle = Particle 
  { _pos :: V3 Integer
  , _vel :: V3 Integer
  , _accel :: V3 Integer
  }
  deriving (Eq,Show)
makeLenses ''Particle

part1 = filterByMin accel $ zip [0..] ps
  where
    (Success ps) = parseInput test

filterByMin :: Lens' Particle (V3 Integer) -> [(Int,Particle)] -> [(Int,Particle)]
filterByMin l ps = map (\(c,(p,_)) -> (c,p)) filtered
    where
      filtered =  filter ((== minP) . snd . snd) mins
      minP = snd $ snd $ minimumBy (compare `on` (snd . snd)) mins
      mins ::  [(Int,(Particle,Integer))]
      mins = map (over _2 (\p -> (p,distanceFromZero l p))) ps

part2 = length $ last $ take 100000 $ iterate collideStep ps
  where
    (Success ps) = parseInput input

distanceFromZero :: Lens' Particle (V3 Integer) -> Particle -> Integer
distanceFromZero l = getSum . foldMap (Sum . abs) . view l

collideStep :: [Particle] -> [Particle]
collideStep = concat . filter ((== 1) . length) . groupBy ((==) `on` view pos) . sortOn (view pos) . map step

step :: Particle -> Particle
step (Particle p v a) = Particle p' v' a
  where
    !p' = p ^+^ v'
    v' = v ^+^ a

parseInput :: String -> Result [Particle]
parseInput = parseString (some (particleP <* skipOptional newline)) mempty

particleP :: Parser Particle
particleP = (\[x,y,z] ->Particle x y z) <$> commaSep1 partP
  where
    partP = (letter *> char '=') *> vectorP
    vectorP = (\[x,y,z] -> V3 x y z) <$> angles (commaSep1 integer)

